/* import Typed from "react-typed"
import SideLeft from "./SideLeft"
import SideRight from "./SideRight" */
import { useParams,useHistory,NavLink } from "react-router-dom"
import {useState} from "react"
import axios from "axios"
import object from "./data"

function SingleVerb() {
    /* console.log("hermann") *//* 
    const [test, settest] = useState("")
    const [Infinitif, setInfinitif] = useState("")
    const [InfinitifValeur, setInfinitifValeur] = useState("") */
    const { singleVerb } = useParams()
    const verbSingleOne = singleVerb.split(".")[0]
    console.log("single",verbSingleOne.split(".")[0])
    const [inputValue, setinputValue] = useState(verbSingleOne)
    let [VerbTousLesTemps] = useState("")
    const [titre, settitre] = useState("")
    const [valeurTitre, setvaleurTitre] = useState("")
    const [SimplePast1, setSimplePast1] = useState("")
    const [SimplePastValue, setSimplePastValue] = useState("")
    const [PastParticipe, setPastParticipe] = useState("")
    const [PastParticipeValue, setPastParticipeValue] = useState("")
    const [SimplePresent, setSimplePresent] = useState("")
    const [PresentI, setPresentI] = useState("")
    const [PresentIRresult, setPresentIRresult] = useState("")
    const [PresentYou, setPresentYou] = useState("")
    const [PresentYouResult, setPresentYouResult] = useState("")
    const [PresentHe, setPresentHe] = useState("")
    const [PresentHeResult, setPresentHeResult] = useState("")
    const [PresentWe, setPresentWe] = useState("")
    const [PresentWeResult, setPresentWeResult] = useState("")
    const [PresentYou1, setPresentYou1] = useState("")
    const [PresentYou1Result, setPresentYou1Result] = useState("")
    const [PresentThey, setPresentThey] = useState("")
    const [PresentTheyResult, setPresentTheyResult] = useState("")

    /* present progressive */
    const [PresentProgressive, setPresentProgressive] = useState("")
    const [PresentProgressiveI, setPresentProgressiveI] = useState("")
    const [PresentProgressiveIRresult, setPresentProgressiveIRresult] = useState("")
    const [PresentProgressiveYou, setPresentProgressiveYou] = useState("")
    const [PresentProgressiveYouResult, setPresentProgressiveYouResult] = useState("")
    const [PresentProgressiveHe, setPresentProgressiveHe] = useState("")
    const [PresentProgressiveHeResult, setPresentProgressiveHeResult] = useState("")
    const [PresentProgressiveWe, setPresentProgressiveWe] = useState("")
    const [PresentProgressiveWeResult, setPresentProgressiveWeResult] = useState("")
    const [PresentProgressiveYou1, setPresentProgressiveYou1] = useState("")
    const [PresentProgressiveYou1Result, setPresentProgressiveYou1Result] = useState("")
    const [PresentProgressiveThey, setPresentProgressiveThey] = useState("")
    const [PresentProgressiveTheyResult, setPresentProgressiveTheyResult] = useState("")



    /* present perfect */
    const [PresentPerfect, setPresentPerfect] = useState("")
    const [PresentPerfectI, setPresentPerfectI] = useState("")
    const [PresentPerfectIRresult, setPresentPerfectIRresult] = useState("")
    const [PresentPerfectYou, setPresentPerfectYou] = useState("")
    const [PresentPerfectYouResult, setPresentPerfectYouResult] = useState("")
    const [PresentPerfectHe, setPresentPerfectHe] = useState("")
    const [PresentPerfectHeResult, setPresentPerfectHeResult] = useState("")
    const [PresentPerfectWe, setPresentPerfectWe] = useState("")
